import { Box, Center } from "@chakra-ui/react";


const Conta = () => {
    return(
        <Center>
            <Box backgroundColor='#ffffff' minHeight='22vh'>
                Informações do acesso
            </Box>
            <Box backgroundColor='#ffffff' minHeight='22vh'>
                Informações da conta
            </Box>
        </Center>
    )
}

export default Conta;
